function numbertoBytes(bytes) {
    let unidade = ['bps', 'Kbps', 'Mbps', 'Gbps', 'Tbps', 'Pbps'];

    let m = 0;
    
    for (m = 0; bytes >= 1000; m++) {
        bytes /= 1000;
    }

    return bytes.toFixed(1) + ' ' + unidade[m];
}


